\begin{align*}
(n + 2)(n + 4)(n + 6) &\equiv (7k + 2 + 2)(7k + 2 + 4)(7k + 2 + 6) \\
&\equiv (7k + 4)(7k + 6)(7k + 8) \\
&\equiv (4)(6)(1) \\
&\equiv 24 \\
&\equiv \boxed{3} \pmod{7}
