We can use the triangle inequality to find that $AD+DB\geq AB$, $AC+CD\geq AD$, and $BC+CD\geq BD$. Adding these inequalities, we get $2(AD+DB+CD)\geq AB+AC+BC$. Since $AB=3$, $AC=6$, and $BC=4$, we have $2(AD+DB+CD)\geq 13$, so $AD+DB+CD\geq \frac{13}{2}$. We can achieve this bound by taking $D$ to be the intersection of $AB$ and $CD$, as shown below.

[asy]
pair A,B,C, D;
A = (-3,3); B = (3,0); C = (0, -4); D = (0,0);
draw(D--B--C--cycle); draw(D--A--B--cycle);draw(D--A--C--cycle);
label("$A$", A, NW);label("$B$", B, E); label("$C$", C, S);label("$D$", D, NE);
label("3", D--B, S); label("6", A--B, NE); label("6", A--C, SW); label("4", D--C, NW+N);
label("5", A--D, SE+NE); label("5", C--B, E);
draw(A--D, dashed); draw(C--B, dashed);
[/asy]
